INSERT INTO fundamental_data(id, symbol_id, description, street, city, country, website_url, phone_number, email, market_cap, number_of_employees, founding_year, created, updated) VALUES (1,13,NULL,'Haile Selassie Avenue ','Nairobi',' Kenya ',NULL,NULL,'baumann@net2000ke.com ',42624732.60,NULL,NULL,'2015-08-20 10:42:28','2015-08-20 10:42:28'),(2,14,'AccessKenya is the leading corporate Internet service provider (ISP) in Kenya today with offices in Nairobi and Mombasa. As well as providing world class ISP connectivity to successful businesses it is also at the forefront of broadband IS P services and Corporate Telephone Services and ensures that its valued clients receive the quality, reliability and se rv ice for an excellent price that every business should expect from its Internet service provider.','4th Floor, Museum Hill Centre ','Nairobi','Kenya','www.accesskenya.com ','+254-20-374-959','info@accesskenya.com ',1970463179.65,147,2007,'2015-08-20 11:01:41','2015-08-20 11:01:41'),(3,15,'Athi River Mining Limited was founded in 1973 with the mission of extracting and processing mineral reources availablein Kenya for the purpose to utilizing these as raw materials. The company begun by mining limestone pulverised for useas a gricultural lime, but has since increased its line to minerals to include 15 different minerals, serving over 50 ind us tries throughout the East African region. In the 1990s the company expanded its operations that were limited onlyto min ing to include value added processing of minerals and manufacturing of lime and cement.','Rhino House, Chiromo Road','Westlands','Kenya','www.armcement.com ','+254-020-374462',NULL,31451232500.00,700,1997,'2015-08-20 11:21:09','2015-08-20 11:21:09');
